import React, { useState } from 'react';

const SignupForm = ({ onSignup }) => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    role: '',
    // Customer-specific fields
    full_name: '',
    contact_phone: '',
    address: '',
    preferred_contact_method: '',
    // Moving Company-specific fields
    company_name: '',
    contact_person: '',
    contact_email: '',
    contact_phone_company: '',
    extra_services: '',
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:5000/signup', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        console.log('Signup successful');
        onSignup();
      } else {
        console.error('Signup failed');
      }
    } catch (error) {
      console.error('Error during signup:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Username:
        <input type="text" name="username" value={formData.username} onChange={handleChange} />
      </label>
      <br />
      <label>
        Email:
        <input type="email" name="email" value={formData.email} onChange={handleChange} />
      </label>
      <br />
      <label>
        Password:
        <input type="password" name="password" value={formData.password} onChange={handleChange} />
      </label>
      <br />
      <label>
        Role:
        <select name="role" value={formData.role} onChange={handleChange}>
          <option value="">Select Role</option>
          <option value="customer">Customer</option>
          <option value="moving_company">Moving Company</option>
        </select>
      </label>
      <br />

      {/* Customer-specific fields */}
      {formData.role === 'customer' && (
        <>
          <label>
            Full Name:
            <input type="text" name="full_name" value={formData.full_name} onChange={handleChange} />
          </label>
          <br />
          <label>
            Contact Phone:
            <input type="text" name="contact_phone" value={formData.contact_phone} onChange={handleChange} />
          </label>
          <br />
          <label>
            Address:
            <input type="text" name="address" value={formData.address} onChange={handleChange} />
          </label>
          <br />
          <label>
            Preferred Contact Method:
            <input
              type="text"
              name="preferred_contact_method"
              value={formData.preferred_contact_method}
              onChange={handleChange}
            />
          </label>
          <br />
        </>
      )}

      {/* Moving Company-specific fields */}
      {formData.role === 'moving_company' && (
        <>
          <label>
            Company Name:
            <input type="text" name="company_name" value={formData.company_name} onChange={handleChange} />
          </label>
          <br />
          <label>
            Contact Person:
            <input type="text" name="contact_person" value={formData.contact_person} onChange={handleChange} />
          </label>
          <br />
          <label>
            Contact Email:
            <input type="email" name="contact_email" value={formData.contact_email} onChange={handleChange} />
          </label>
          <br />
          <label>
            Contact Phone (Company):
            <input type="text" name="contact_phone_company" value={formData.contact_phone_company} onChange={handleChange} />
          </label>
          <br />
          <label>
            Extra Services:
            <input type="text" name="extra_services" value={formData.extra_services} onChange={handleChange} />
          </label>
          <br />
        </>
      )}

      <button type="submit">Sign Up</button>
    </form>
  );
};

export default SignupForm;
